precis:
Appointment of the following judges as Judges of the Court Martial Appeal Court of Canada:

a) the Honourable WYMAN W. WEBB of the Federal Court of Appeal;
b) the honourable MARY J.L. GLEASON of the Federal Court;
c) the honourable JOCELYNE GAGNÉ of the Federal Court;
d) the honourable CATHERINE M. KANE of the Federal Court;
e) the honourable MICHAEL D. MANSON of the Federal Court; and
f) the honourable JEAN-PIERRE PLOUFFE of the Superior Court of Quebec.
